import React from 'react';
import {Link} from 'react-router-dom';

const Nav = ({dogs}) => {
    return (
        <div>
            {dogs.map(animals => (
                <Link>
                    {animal}
                </Link>
            ))}
        </div>
    )
}

export default Nav;
